import React, { useState } from 'react'

const RestaurantDetails = (props) => {

  let opHours=Object.entries(props.detail.operating_hours);
  console.log(opHours)
  return (
    <div id="detail">
        <img alt={props.detail.name} src={props.detail.photograph}/>
        <div>
          <h2>{props.detail.name}</h2>
          <p>Operational Hours :---</p>
          {opHours.map((item)=><p>{item[0]}-{item[1]}</p>)}
          <h3>Reviews:</h3>
          <div id="reviews">
            {props.detail.reviews.map((item)=>{ return <div className="review"><div><p className='reviewName'>{item.name}</p><p className='reviewDate'>{item.date}</p></div><p className='reviewRating'>{item.rating}</p><p id="reviewComments">{item.comments}</p></div>})}
          </div>
        </div>
    </div>
  )
}

export default RestaurantDetails
